  const toggleMode=()=>{
    if(mode==="light")
    {
      setMode("")
    }

  }
  return (
    <>
      <Navbar title="Text" mode={mode}/>
      <div className="container">
        <TextForm heading="Enter Text Here" />
      </div>
      <div className="container my-2">
      {/* <About/> */}
      </div>

    </>
  );
}

export default App;
